reports.query:
MATCH (a:Airport)
RETURN a.labelPropagation AS Grupo, COLLECT(a.name) AS Miembros
ORDER BY Grupo;

MATCH (a:Airport)
RETURN a.stronglyConnected AS Grupos, COLLECT(a.name) AS Miembros
ORDER BY Grupos;

MATCH (a:Airport)
RETURN a.stronglyConnected AS Grupo, COLLECT(a.name) AS Miembros
ORDER BY Grupo DESC, SIZE(Miembros);
